import { useParams } from 'react-router-dom';
import { useSelector,useDispatch } from 'react-redux';


const FilterFeature = () => {
    const {type} =useParams();
     const dispatch = useDispatch();
     useEffect(() => {
       
dispatch({type:"FEATURED",type:type})

     }, [type])

    
    return (
        <div>
       <h2>{type}</h2>     
       
        </div>
    )
}

export default FilterFeature
